import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from '../pages/Home';
import Catalog from '../pages/Catalog';
import Detail from '../pages/detail/Detail';
import Mainpage from '../Mainpage';
import SignIn from "./"

const Routes = () => {
    return (
        <Switch>
            <Route
                path='/:category/search/:keyword'
                component={Catalog}
            />
            <Route
                path='/:category/:id'
                component={Detail}
            />
            <Route
                path='/:category'
                component={Catalog}
            />
            <Route
                path='/'
                exact
                component={Mainpage}
            />
            <Route
                path='/signin'
                exact
                component={Signin}
            />
            <Route
                path='/signup'
                exact
                component={SignUp}
            />

        </Switch>
    );
}

export default Routes;
